import pic5 from './images/ser5.webp';
import pic6 from './images/ser6.jpeg';
const Sdata=

    [
        {
           imgsrc:pic1,
           title: "web development"
        },
        {
            imgsrc:pic2,
            title:"app development"
        },
        {
           imgsrc:pic3,
           title:"machine learning"
        },
        {
          imgsrc:pic4,
          title:"data science"
        },
        {
          imgsrc:pic5,
          title:"python developer"
        },
        { 
          imgsrc:pic6,
          title:"Competitive programing"
        }
    ]
export default Sdata;
